import React from 'react';
import HeaderPanel from './HeaderPanel';
import SecondPanel from './SecondPanel';
import ThirdPanel from './ThirdPanel';
import './App.css';

const App = () => {
  return (
    <div className='App'>
      <HeaderPanel />
      <div className='App-panelContainer'>
        <SecondPanel />
        <ThirdPanel />
      </div>
    </div>
  );
};

export default App;
